import React, { useState, useEffect } from 'react';
import '../css/Rutas.css'; // Asegúrate de crear este archivo CSS

const Rutas = () => {
  const [rutas, setRutas] = useState([]);
  const [currentMonth, setCurrentMonth] = useState(new Date().getMonth());
  const [currentYear, setCurrentYear] = useState(new Date().getFullYear());

  useEffect(() => {
    // Simulación de carga de datos de programación
    const scheduleData = require('../data/september-2025-schedule.json');
    const processedRutas = processScheduleData(scheduleData, currentMonth, currentYear);
    setRutas(processedRutas);
  }, [currentMonth, currentYear]);

  const processScheduleData = (scheduleData, month, year) => {
    const rutasData = [];
    const daysInMonth = new Date(year, month + 1, 0).getDate();

    for (let day = 1; day <= daysInMonth; day++) {
      const date = new Date(year, month, day);
      const formattedDate = date.toLocaleDateString('es-ES', { day: '2-digit', month: '2-digit', year: 'numeric' });

      scheduleData.forEach(person => {
        const scheduleForDay = person.schedule.find(s => s.day === day);
        if (scheduleForDay) {
          const { turn } = scheduleForDay;
          const commonData = {
            // AREA: '', // Datos aún no disponibles
            CEDULA: person.id,
            NOMBRE: person.name,
            // CORREO: '', // Datos aún no disponibles
          };

          if (turn === 'M') { // Turno Mañana
            rutasData.push({
              ...commonData,
              FECHA: formattedDate,
              ORIGEN: 'CASA',
              DESTINO: 'REDEBAN',
              HORA: '06:00:00',
            });
          } else if (turn === 'T') { // Turno Tarde
            rutasData.push({
              ...commonData,
              FECHA: formattedDate,
              ORIGEN: 'REDEBAN',
              DESTINO: 'CASA',
              HORA: '22:00:00',
            });
          } else if (turn === 'N') { // Turno Noche
            // Registro 1 (ida)
            rutasData.push({
              ...commonData,
              FECHA: formattedDate,
              ORIGEN: 'CASA',
              DESTINO: 'REDEBAN',
              HORA: '22:00:00',
            });
            // Registro 2 (vuelta al día siguiente)
            const nextDay = new Date(date);
            nextDay.setDate(date.getDate() + 1);
            const nextDayFormatted = nextDay.toLocaleDateString('es-ES', { day: '2-digit', month: '2-digit', year: 'numeric' });
            rutasData.push({
              ...commonData,
              FECHA: nextDayFormatted,
              ORIGEN: 'REDEBAN',
              DESTINO: 'CASA',
              HORA: '06:00:00',
            });
          }
        }
      });
    }
    return rutasData;
  };

  const handleMonthChange = (increment) => {
    setCurrentMonth(prevMonth => {
      let newMonth = prevMonth + increment;
      let newYear = currentYear;
      if (newMonth > 11) {
        newMonth = 0;
        newYear++;
      } else if (newMonth < 0) {
        newMonth = 11;
        newYear--;
      }
      setCurrentYear(newYear);
      return newMonth;
    });
  };

  return (
    <div className="rutas-container">
      <h2>Gestión de Rutas</h2>
      <div className="month-navigator">
        <button onClick={() => handleMonthChange(-1)}>&lt; Anterior</button>
        <span>{new Date(currentYear, currentMonth).toLocaleString('es-ES', { month: 'long', year: 'numeric' })}</span>
        <button onClick={() => handleMonthChange(1)}>Siguiente &gt;</button>
      </div>
      <div className="table-responsive">
        <table className="rutas-table">
          <thead>
            <tr>
              {/* <th>ÁREA</th> */}
              <th>CÉDULA</th>
              <th>FECHA</th>
              <th>NOMBRE</th>
              <th>ORIGEN</th>
              <th>DESTINO</th>
              <th>HORA</th>
              {/* <th>CORREO</th> */}
            </tr>
          </thead>
          <tbody>
            {rutas.map((ruta, index) => (
              <tr key={index}>
                {/* <td>{ruta.AREA}</td> */}
                <td>{ruta.CEDULA}</td>
                <td>{ruta.FECHA}</td>
                <td>{ruta.NOMBRE}</td>
                <td>{ruta.ORIGEN}</td>
                <td>{ruta.DESTINO}</td>
                <td>{ruta.HORA}</td>
                {/* <td>{ruta.CORREO}</td> */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Rutas;
